import React, { Component } from 'react';

class Card extends Component {
  state = {}
  onClick() {
    console.log(this.props.title);
  }
  render() {
    return (
      <div className="project-card" onClick={this.onClick}>
        <h2>{this.props.title}</h2>
        <p>{this.props.description}</p>
      </div>
    );
  }
}
//functions

export default Card;
